create table log4j
(
	Id int not null auto_increment
		primary key,
	level varchar(255) default '' not null,
	category varchar(255) default '' not null,
	thread varchar(255) default '' not null,
	time varchar(30) default '' not null,
	location varchar(255) default '' not null,
	note text null
)
;

comment on column log4j.level is '优先级'
;

comment on column log4j.category is '类目'
;

comment on column log4j.thread is '进程'
;

comment on column log4j.time is '时间'
;

comment on column log4j.location is '位置'
;

comment on column log4j.note is '日志信息'
;































